import React from 'react';
import './Navbar.css';

const DropdownSneak = () => { // Cambio en el nombre del componente
    return (
        <div className='flex flex-col dropdown'>
            <ul className='flex flex-col gap-4'>
                <li>Sneakers</li>
                <li>Adidas</li>
                <li>Nike</li>
                <li>New Balance</li>
                <li>Jordan</li>
            </ul>
        </div>
    )
}

export default DropdownSneak;
